@app.get("/discount")
def get_discount(code: str = Query(..., description="Discount code to lookup")):
    try:

        BASE_URL = f"https://{SHOP_NAME}.myshopify.com/admin/api/{API_VERSION}"
        HEADERS = {
            "Content-Type": "application/json",
            "X-Shopify-Access-Token": ACCESS_TOKEN
        }

        # Step 1: Lookup discount code
        lookup_url = f"{BASE_URL}/discount_codes/lookup.json?code={code}"
        lookup_res = requests.get(lookup_url, headers=HEADERS)

        if lookup_res.status_code != 200:
            raise HTTPException(status_code=lookup_res.status_code, detail="Error fetching discount code")

        discount_data = lookup_res.json().get("discount_code")
        if not discount_data:
            raise HTTPException(status_code=404, detail="Discount code not found")

        price_rule_id = discount_data.get("price_rule_id")

        # Step 2: Get price rule details
        price_rule_url = f"{BASE_URL}/price_rules/{price_rule_id}.json"
        price_rule_res = requests.get(price_rule_url, headers=HEADERS)

        if price_rule_res.status_code != 200:
            raise HTTPException(status_code=price_rule_res.status_code, detail="Error fetching price rule")

        price_rule_data = price_rule_res.json().get("price_rule")

        # Extract simplified response
        value_type = price_rule_data.get("value_type")  # percentage or fixed_amount
        raw_value = price_rule_data.get("value")       # negative value
        formatted_value = ""

        if value_type == "percentage":
            formatted_value = f"{abs(float(raw_value))}%"
        elif value_type == "fixed_amount":
            formatted_value = f"{abs(float(raw_value))} {price_rule_data.get('currency', 'LE')}"
        else:
            formatted_value = str(raw_value)

        # Final simplified response
        return {
            "code": discount_data.get("code"),
            "type": value_type,
            "value": formatted_value
        }

    except Exception as e:
        raise HTTPException(status_code=500, detail=str(e))

@app.post("/customer/graphql")
async def customer_graphql_proxy(request: Request):
    """
    بروكسي لاستعلامات Customer Account API
    """
    try:
        # جلب التوكن من الهيدر
        auth_header = request.headers.get("Authorization", "")
        
        # إزالة كلمة "Bearer " إذا كانت موجودة
        if auth_header.startswith("Bearer "):
            customer_access_token = auth_header.replace("Bearer ", "").strip()
        else:
            customer_access_token = auth_header.strip()
        
        if not customer_access_token:
            return JSONResponse(
                status_code=401, 
                content={"errors": [{"message": "Missing Authorization header"}]}
            )
        
        # جلب الاستعلام من البودي
        body = await request.json()
        query = body.get("query", "")
        variables = body.get("variables", {})
        
        if not query:
            return JSONResponse(
                status_code=400, 
                content={"errors": [{"message": "Missing GraphQL query"}]}
            )
        
        # إعداد الطلب لشوبيفاي - بدون كلمة Bearer
        headers = {
            "Content-Type": "application/json",
            "Authorization": customer_access_token,  # بدون "Bearer"
            "X-Shopify-Store-Id": SHOPIFY_STORE_ID
        }
        
        payload = {
            "query": query,
            "variables": variables
        }
        
        # الإرسال لشوبيفاي
        response = requests.post(SHOPIFY_CUSTOMER_ACCOUNT_API_URL, json=payload, headers=headers, timeout=30)
        
        if response.status_code != 200:
            logging.error(f"Shopify API error: {response.status_code} - {response.text}")
            return JSONResponse(
                status_code=response.status_code,
                content={"errors": [{"message": "Shopify API error"}]}
            )
        
        return response.json()
        
    except requests.exceptions.RequestException as e:
        logging.error(f"Request error: {e}")
        return JSONResponse(
            status_code=500,
            content={"errors": [{"message": f"Proxy error: {str(e)}"}]}
        )
    except Exception as e:
        logging.error(f"Unexpected error: {e}")
        return JSONResponse(
            status_code=500,
            content={"errors": [{"message": str(e)}]}
        )







